Hej  !!! 
   Jag säljer min bil eftersom jag inte längre använder den !!! 
   Bilen är i gott skick, både utvändigt och invändigt, motor, växellåda och elsystem fungerar bra, inga klagomål, ingen rost !!!        
   Det finns en spricka i vindrutan, men det påverkar inte besiktningen !!! 
   Besiktning fram till 2026.02.28 !!! 
   Bilen har: 
     - sommar- och vinterdäck i gott skick; 
     - en nyckel; 
     - dragkrok. 
   Många delar har bytts ut: 
     - Kamaxelsats med vattenpump; 
     - drivaxelsats; 
     - motorolja och alla filter; 
     - glödstift ( 4 st. );
     - hjullagersats vänster och höger; 
     - spindelram på båda sidor;
      - styrväxelkåpa på båda sidor; - motordämpare; 
     - drivaxelkåpa höger sida. Byten erbjuds inte, endast seriösa köpare är välkomna !!! 
   Med vänliga hälsningar !!!
